style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("y-galforums.com") {
  body, td, th, tr {
    color: #CCC;
    background: #395C7B;
  }
  #header, #content_section, #footer_section, .frame{
    background: #333!important;
  }
  .windowbg2, .windowbg, .info, .lastpost, .upperframe, .lowerframe, .upperframe span, .lowerframe span, .innerframe, .roundframe, .description, .plainbox{
    background: #000!important;
    color: #CCC;
  }
  .stickybg, .stickybg2{
    background: #346;
  }
  h1, h2, h3, h4, h5, h6 {
    color: #FFF;
  }
  a:link, a:visited, a.new_win:link, a.new_win:visited {
    color: #9AC;
    text-decoration: none;
  }
}
